description:
Лучший способ управлять услугами и счетом для абонентов t2 Россия.

Тарифы и услуги
— проверка остатков гигабайт и минут;
— настройка тарифа;
— подключение или отключение дополнительных услуг;
— возможность делиться гигабайтами с абонентами t2;
— удобный виджет для отслеживания остатков и баланса.

Управление счетом
— пополнение баланса с помощью банковской карты;
— установка автоплатежа с привязанной банковской карты;
— использование «Обещанного платежа»;
— просмотр статистики расходов и заказ детализации;

Больше
— скидки, кэшбэк и подарки от наших партнеров;
— уникальные предложения и приглашения на интересные события.
